import React from 'react'
import './Content1.css'
// import '../images/blockchain'

const Content = () => {
  return (
    <div id='content1'>
      <div>
        <h1>What is BlockChain?</h1>
        <p>A blockchain is a distributed database that is shared among the nodes of a computer network.</p>
        <button className='btn btn-primary'>Read More</button>
      </div></div>
  )
}

export default Content
